.
1️⃣Aquaplaning. Es cuando la pista está mojada o está lloviendo y el coche lleva ruedas de seco o slick y el neumático no puede drenar en su totalidad el agua, por lo tanto se crea una película de agua entre la rueda y el asfalto.
.
2️⃣Box. El Box es el pequeño taller que tienen los equipos en cada GP para arreglar sus coches, hacer setups, etc.
.
3️⃣Rebufo. Es un fenómeno que produce la retroalimentación de corrientes de aire que se concentran en un elemento o en este caso en un coche de f1, básicamente cuando los coches van enfrente uno del otro, el de adelante deja un agujero en el aire que el coche de detrás lo aprovecha para ir más rápido.
.
4️⃣Chicane. La chicane es una especie de curva en forma de "S", que se construyen generalmente después de una recta muy larga, para que los coches bajan la velocidad, también se hace por seguridad.
.
5️⃣Stop & Go. Es una penalización que puede durar de 5 a 10 segundos y se le pone a los pilotos por haber cometido algún acto indebido en carrera, consiste en que el piloto tiene que pasar por los pits y parar el tiempo con que lo hayan sancionado.
.
6️⃣Overcut. Es una estrategia de carreras que los ingenieros de cada equipo deciden y consiste en retrasar la entrada en pits cuando dos pilotos o más están peleando por una posición *esto depende de la llanta que lleve cada coche y depende si tienen desgaste o no*.
.
7️⃣Grip. Básicamente es el agarre que tienen las llantas con la pista.
.
8️⃣Marshall. Son llamados también comisarios de carreras, son los que estan en el deber de vigilar que los pilotos no cometan ningún error, y si lo cometen ellos avisan y se decide si ponen penalización o no, también son los encargados de ayudar a los pilotos en pista por si chocan.
.
9️⃣Halo. Pieza de titanio que se implementó en el 2018 para la protección de los pilotos.

